patch:
diff --git a/magic/main.py b/magic/main.py
index ba610ff..9ec8480 100644
--- a/magic/main.py
+++ b/magic/main.py
@@ -19,7 +19,7 @@ def fibonacci_substraction(n):
     def f(n):
         return n * (n < 3) or f(n - 1) - f(n - 2)

-    return f(n)
+    return f(n+1)


 if __name__ == "__main__":

diff --git a/magic/main.py b/magic/main.py
index ba610ff..66db0bd 100644
--- a/magic/main.py
+++ b/magic/main.py
@@ -19,7 +19,7 @@ def fibonacci_substraction(n):
     def f(n):
         return n * (n < 3) or f(n - 1) - f(n - 2)

-    return f(n)
+    return f(n) * (n % 2 == 0) or f(n) * (n % 2 != 0)


 if __name__ == "__main__":

diff --git a/magic/main.py b/magic/main.py
index ba610ff..e3978e2 100644
--- a/magic/main.py
+++ b/magic/main.py
@@ -19,7 +19,7 @@ def fibonacci_substraction(n):
     def f(n):
         return n * (n < 3) or f(n - 1) - f(n - 2)

-    return f(n)
+    return f(n) if n > 0 else n


 if __name__ == "__main__":

